	private void raiseError(String errmsg, final RestChannel channel, final RestRequest orgrequest)
	{
		logger.error(errmsg);
		XContentBuilder builder;
		try 
		{
			//builder = restContentBuilder(orgrequest);
			builder = channel.newBuilder();
			builder.startObject();
			builder.field("error", errmsg);
			builder.endObject();
			//channel.sendResponse(new XContentRestResponse(orgrequest, BAD_REQUEST, builder));
			channel.sendResponse(new BytesRestResponse(BAD_REQUEST, builder));
		} catch (IOException e1) {
			// TODO Auto-generated catch block
			e1.printStackTrace();
		}
		
	}

	private String processAMREntsTemplate(String JsonContent, HSECResponse hsecresponse)
	{
		StringBuilder sbuilder = new StringBuilder();
		int p1 = JsonContent.indexOf(amrTemplate);
		int p2 = JsonContent.indexOf(amrTemplate, p1+ amrTemplate.length() );
		int p3 = JsonContent.indexOf(amrTemplate, p2+ amrTemplate.length() );
		
		if( p1 > 0 )
		{
			sbuilder.append(JsonContent.substring(0,p1));
			if( hsecresponse.groupsToRemove_.size() == 0 )
				sbuilder.append("0");
			else
				sbuilder.append(Joiner.on(", ").join(hsecresponse.groupsToRemove_));
			if( p2 > 0 )
			{
				sbuilder.append(JsonContent.substring(p1 + amrTemplate.length(), p2 ));	//to the p2
				if( hsecresponse.groupsToRemove_.size() == 0 )
					sbuilder.append("0");
				else
					sbuilder.append(Joiner.on(", ").join(hsecresponse.groupsToRemove_));
				if( p3 > 0 )
				{
					sbuilder.append(JsonContent.substring(p2 + amrTemplate.length(), p3 ));	//to the p2
					if( hsecresponse.groupsToRemove_.size() == 0 )
						sbuilder.append("0");
					else
						sbuilder.append(Joiner.on(", ").join(hsecresponse.groupsToRemove_));
    				sbuilder.append(JsonContent.substring(p3 + amrTemplate.length() ));	//to the end
				}
				else
				{
					sbuilder.append(JsonContent.substring(p2 + amrTemplate.length() ));	//to the end
				}
			}
			else
			{
				sbuilder.append(JsonContent.substring(p1 + amrTemplate.length() ));	//to the end
			}
		}
		return sbuilder.toString();
	}

